import {} from 'react-icons/fi'

const options = [
    {
        nome: 'Página Inicial',
        icone: 'FiHome' 
    },
    {
        nome: 'Pesquisa',
        icone: 'FiSearch' 
    },
    {
        nome: 'Explorar',
        icone: 'FiGlobe' 
    },
]

export default function SideNav(op) {
    

    return (
        <div>
            <ul>
                {options.map((opt => {
                    <li key={opt.icone}>
                        {`<${opt.icone}/>`}
                        <h1>{opt.nome}</h1>
                    </li>
                }))}
            </ul>
        </div>
    )
}
